import React, { Fragment } from "react";
import { Content } from "../Components/Content";
import { Card } from "react-bootstrap";
import { NavLink } from "react-router-dom";
import coursesThumbnail from "../img/CoursesThumbnail.svg";
function LecturerMyCourses() {
    return (
        <Fragment>
            <Content>
                <div id="lecturerMyCourses" style={{ padding: "2rem" }}>
                    <h3 className="my-4" style={{fontWeight: "600"}}>My Courses</h3>
                    <NavLink to="/LecturerMyCourses" style={{ color: "black" }}>
                        <Card className="cardDashboard" style={{ width: "25%", backgroundColor: "" }}>
                            <img src= {coursesThumbnail} alt="courses thumbnail"></img>
                            <h4 className="card-title">Machine Learning And Data Analysis</h4>
                            <p className="cardName" style={{ fontSize: "14px", fontWeight: "600", opacity: "0.7" }}>My Courses</p>
                            <p className="cardValue mb-0 d-flex justify-content-end" style={{ fontSize: "28px", fontWeight: "900" }}>13</p>
                        </Card>
                    </NavLink>
                </div>
            </Content>
        </Fragment>
    );
}
export default LecturerMyCourses;
